import "./Popup.css";
const Popup=(props)=>{

    return(props.trigger)?(
        <div className="popup">
            <div className="popup_inner">
                {props.children}
                <img className="popup_close-btn" onClick={()=>props.setTrigger(false)} src="https://png.pngtree.com/element_our/20190601/ourlarge/pngtree-white-cancel-button-icon-image_1338668.jpg"></img>
                <div className="popup_login-text">
                    Login to continue
                </div>
            </div>
        </div>
        ) : ""

}

export default Popup;
